import React,{useState} from 'react'

export default function Home() {
  const [sum,setSum] = useState(1)
  return (
    <div>
      <h3>我是Home组件</h3>
      <h4>当前的sum值:{sum}</h4>
      <button onClick={()=>setSum}>点我将sum变为2</button>
    </div>
  )
}
